import React from "react";
import Facebook from "../resource/fcb.svg";
import Twitter from "../resource/twitter.svg";
import GooglePlus from "../resource/gPlus.svg";
import MapIcon from "../resource/map.svg";
import PhoneIcon from "../resource/phone.png";
import MailIcon from "../resource/mail.png";
import "../styles/contact.css"
import {contactContentData} from "../actions/contactAC";
import {connect} from "react-redux";

class Contact extends React.Component {
    componentDidMount() {
        this.props.fetchData("http://localhost/backend/contact.php");
    }

    render() {
        console.log(this.props.contact)
        return (
            <div className="contactContent" id="contact">
                <div className="contact">
                    <h2>{this.props.contact.name}</h2>
                    <h5>{this.props.contact.context}</h5>
                    <div className="information">
                        <div>
                            <img src={MapIcon} alt="map"/>
                            <h6>{this.props.contact.contacts ? this.props.contact.contacts["addres"] : ""}</h6>
                        </div>
                        <div>
                            <img src={PhoneIcon} alt="phone"/>
                            <h6>{this.props.contact.contacts ? this.props.contact.contacts["phone"] : ""}</h6>
                        </div>
                        <div>
                            <img src={MailIcon} alt="Mail"/>
                            <h6>{this.props.contact.contacts ? this.props.contact.contacts["mail"] : ""}</h6>
                        </div>
                    </div>
                    <h3>FOLLOW US</h3>
                    <div className="social">
                        <a href={this.props.contact.social ? this.props.contact.social["fb"] : ""}><div><img src={Facebook} alt="Facebook"/></div></a>
                        <a href={this.props.contact.social ? this.props.contact.social["twitter"] : ""}><div><img src={Twitter} alt="Twitter"/></div></a>
                        <a href={this.props.contact.social ? this.props.contact.social["gMail"] : ""}><div><img src={GooglePlus} alt="GooglePlus"/></div></a>
                    </div>
                </div>
                <form>
                    <h2>{this.props.contact.submit ? this.props.contact.submit["name"] : ""}</h2>
                    <h5>{this.props.contact.submit ? this.props.contact.submit["context"] : ""}</h5>
                    <input placeholder="Name" type="text"/>
                    <input placeholder="Email" type="text"/>
                    <input placeholder="Subject" type="text"/>
                    <textarea placeholder="Message"></textarea>
                    <button>SUBMIT</button>
                </form>
            </div>
        )
    }
}

const mapStateToProps = state => ({
    contact: state.contact
});

const mapDispatchToProps = dispatch => ({
    fetchData: url => dispatch(contactContentData(url))
});
export default connect(mapStateToProps, mapDispatchToProps)(Contact)
